import { addDoc, collection, getFirestore } from 'firebase/firestore';
import { useState } from 'react';
import { useHistory } from 'react-router-dom';
import AuthGoogle from '../../services/Api';
import firebaseConfig from '../../services/config/firebase';
import { Container, ContainerLogin, ContainerLoginFormBtn, DivLogo, LoginForm, LoginFormTitle, 
  LogoForm, WrapInput, WrapLogin } from './styles';
  import roda from '../../assets/Imag/roda.gif'


const AddAdmin: React.FC = () => {
  
  const [email, setEmail] = useState("")
  const [password, setPassword] = useState("")

  const db = getFirestore(firebaseConfig)
  const admCollectionRef = collection(db, "admin")
  
  //Add novos usuários no  banco de dados
  async function creatAdmin() {    
    const adm = await addDoc(admCollectionRef,{
      email, password
    })
     if(!adm){
      'usuário não cadastrado'
    }
    console.log(adm)
  }
  const history = useHistory();
  const handleClick = () => {
    history.push('/entrar')
  }  


  return (
    <Container>
      <ContainerLogin>
        <WrapLogin>
          <LoginForm>
            <LoginFormTitle>Bem vindo ao App de Aniversariantes</LoginFormTitle>
            <DivLogo>
              <LogoForm><img src={roda} alt="CakeNiver" /></LogoForm>
            </DivLogo>
            <WrapInput>
              <input
                className={email !== "" ? 'has-val input' : 'input'}
                type='email'
                value={email}
                onChange={e => setEmail(e.target.value)}
              />
              <span className='FocusInput' data-placeholder='Email'></span>
            </WrapInput>

            <WrapInput>
              <input
                className={password !== "" ? 'has-val input' : 'input'}
                type='password'
                value={password}
                onChange={e => setPassword(e.target.value)}
              />
              <span className='FocusInput' data-placeholder='Password'></span>
            </WrapInput>

            <ContainerLoginFormBtn>
              <button className="login-form-btn">Login</button>
            </ContainerLoginFormBtn>

            <div className="text-criarConta"></div>
            <span className="txt1" onClick={creatAdmin}>Salvar</span>
            <a href="#" onClick={handleClick} className="txt2">Logar</a>
          </LoginForm>
          <AuthGoogle />
        </WrapLogin>
      </ContainerLogin>
    </Container>

  )
}

export default AddAdmin
